import React, { useEffect } from 'react';
import axios from 'axios';

import Search from '../page/Search';

function SearchContainer( props ) {
    const userId = props.location.id;

    useEffect(() => {
        const res = axios.get('https://api.nexon.co.kr/kart/v1.0/users/nickname/{'+ userId +'}',
        {
            headers: {
                Header: 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJhY2NvdW50X2lkIjoiNzM4NjMzMjE1IiwiYXV0aF9pZCI6IjIiLCJ0b2tlbl90eXBlIjoiQWNjZXNzVG9rZW4iLCJzZXJ2aWNlX2lkIjoiNDMwMDExMzkzIiwiWC1BcHAtUmF0ZS1MaW1pdCI6IjUwMDoxMCIsIm5iZiI6MTYwNzMxMTc5NSwiZXhwIjoxNjIyODYzNzk1LCJpYXQiOjE2MDczMTE3OTV9.nQaW1EqommasOtUCvfFT5USLDGxrfNbBJPLtOBNMTIE' 
            }
        });
        console.log( res );        
    },[])

    return (
        <Search />
    )
}
